package com.neusoft.fzgl.deliver.model;

public class Deliver {
	private Integer deliverId;
	private String deliverName;
	private Integer deliverState;
	public Deliver() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Deliver(Integer deliverId, String deliverName, Integer deliverState) {
		super();
		this.deliverId = deliverId;
		this.deliverName = deliverName;
		this.deliverState = deliverState;
	}
	public Integer getDeliverId() {
		return deliverId;
	}
	public void setDeliverId(Integer deliverId) {
		this.deliverId = deliverId;
	}
	public String getDeliverName() {
		return deliverName;
	}
	public void setDeliverName(String deliverName) {
		this.deliverName = deliverName;
	}
	public Integer getDeliverState() {
		return deliverState;
	}
	public void setDeliverState(Integer deliverState) {
		this.deliverState = deliverState;
	}
	@Override
	public String toString() {
		return "Deliver [deliverId=" + deliverId + ", deliverName=" + deliverName + ", deliverState=" + deliverState
				+ "]";
	}
	
}
